'''Trading sticks''' are the main currency of the jungle village of [[Tai Bwo Wannai]] on [[Karamja]]. They can be received by participating in the [[Tai Bwo Wannai Cleanup]] [[minigame]], selling items to [[Gabooty's Tai Bwo Wannai Cooperative]], or killing Karamja-related monsters such as [[jogre]]s.

==Acquiring trading sticks==
Players receive favour with the villagers of Tai Bwo Wannai by participating in the [[Tai Bwo Wannai Cleanup]] minigame. If players talk to the villagers and tell them they've done some work, they will give the player some trading sticks in exchange for some of the player's favour. Wearing pieces of the [[villager clothing]] set will cause the villagers to give you more trading sticks exchanged to favour. This is the most efficient way to get trading sticks since players can also train several skills while playing the minigame.

'''Note''': Players need to have repaired the fence in the village and then spoken to [[Murcaily]] before the villagers will have the option to give them trading sticks.

Players can mine semi-precious gems such as [[Opal]], [[Jade]] and [[Red topaz|Red Topaz]] or buy them from the [[Grand Exchange]] and sell it to [[Gabooty]] for trading sticks if one doesn't want to do [[Tai Bwo Wannai Cleanup]]. Mining the [[Shilo Village mine|Shilo Village Gem rocks]] for semi-precious gems and selling them to Gabooty is the fastest way to obtain trading sticks for Ironmen. 

