==Uses==
===The Village Shop===
Gabooty's [[Gabooty's Tai Bwo Wannai Cooperative|shop]] is located within the fenced area of Tai Bwo Wannai. Players can trade for premade gnome cocktails, villager clothes, gem [[machete]]s, semi-precious [[gem]]s ([[opal]], [[jade]], [[red topaz]]), and [[gout tuber]]s, which are normally out of stock.

===Hardwood Grove===
Players can pay 100 trading sticks to access the [[Hardwood Grove]], an enclosed area near the eastern end of the village containing [[mahogany]] and [[teak]] trees.

=== Rionasta's Parcel Service ===
Players can, for a fee of 10 trading sticks per item, ship items from their inventory to their bank via [[Rionasta]]. This is particularly handy when cutting wood in the Hardwood grove, playing the Tai Bwo Wannai Cleanup minigame or banking loot obtained from [[Brimhaven Dungeon]] via [[Banisoch]]'s entrance.

No forms of currency can be shipped using this method.

===Banisoch===
5000 trading sticks can be used as a one-time payment to [[Banisoch]] to access a shortcut to the [[metal dragon]] area of the [[Brimhaven Dungeon]].

